INSERT INTO `sds_info_matter_usage` (`serial_number`, `matter_usage`, `note`) VALUES
	(1, '원료 및 중간체 Feed materials ', '새로운 물질의 합성, 혼합물의 배합 등에 사용되는 원료 및 그 과정에서 발생되는 중간체'),
	(2, '접착제 및 실런트 Adhesives, sealants', '두 물체의 접촉면을 접합시키거나 두 개의 개체를 결합시키는 물질'),
	(3, '흡착제Adsorbents', '가스나 액체를 흡착하는 물질'),
	(4, '방향제 및 탈취제 등 Air care products', '실내 공기 중에 냄새를 발생시키거나 의류 등의 냄새를 제거하는데 사용되는 물질'),
	(5, '냉동방지 및 결빙제거제 Anti-Freeze and de-icing products', '냉각에 의하여 고화되는 것을 방지하거나 얼음을 제거하는 물질'),
	(6, '금속(금속 광물 포함) 및 합금 Base metals and alloyes', '납, 구리 등 하나의 원소로 이루어진 금속 및 하나의 금속에 한 종류 이상의 금속을 첨가하여 만든 금속 '),
	(7, '살생물제 Biocidal products', '농작물 이외의 대상에 대하여 유해생물을 제거, 무해화(無害化) 또는 억제하기 위해 사용되는 물질(농약 제외)'),
	(8, '코팅, 페인트, 신너, 페인트 제거제 Coatings and paints, thinners, paint removers', '표면에 피막을 입히거나 제거하는데 사용되는 물질 '),
	(8.1, '유성 페인트 Oil paint', '신너에 희석하여 사용하는 페인트'),
	(8.2, '수성 페인트 Water paint', '물에 희석하여 사용하는 페인트'),
	(8.3, '신너 Thinner', '페인트 등을 희석하는데 사용하는 용제'),
	(8.4, '페인트 제거제 Paint remover', '도색된 페인트를 표면으로부터 제거하는데 사용하는 물질'),
	(8.5, '경화제 Hardener', '경도를 높이거나 경화를 촉진시키기 위하여 첨가하는 물질'),
	(8.6, '기타 코팅 및 도장 관련 제품 Other coatings and paints ', '표면에 피막을 입히거나 제거하는데 사용되는 물질 중에서 8.1부터 8.5에 해당되지 않는 물질'),
	(9, '필러, 퍼티, 점토 등 Fillers, putties, plasters, modelling clay', '빈 틈이나 공간을 메꾸거나 연결하기 위하여 사용되는 물질'),
	(10, '화약 및 폭발물 Explosives', '화학적 안전성이 있으나 화학적 변화를 거침으로써 폭발 또는 팽창을 동반한 다량의 에너지 및 가스를 매우 빠르게 발생시키는 물질'),
	(11, '비료 Fertilizers ', '식물에 영양을 주거나 식물의 재배를 돕기 위해 흙에서 화학적 변화를 가져오게 하는 물질'),
	(12, '연료 및 연료 첨가제 Fuels and additives', '연소반응을 통해 에너지를 얻을 수 있는 물질 및 연소 효율이나 에어지 효율을 높이기 위하여 연료에 첨가하는 물질(플라스틱 원료는 제외)'),
	(13, '금속 표면 처리제 Metal surface treatment products', '금속표면의 세척 및 세정을 위해서 쓰이는 물질 및 도금공정에서 도금강도를 증가시키기 위해 첨가하는 물질'),
	(14, '비금속 표면 처리제 Non-metal-surface treatment products', '금속 이외의 표면의 세척 및 세정을 위해서 쓰이는 물질 및 도금공정에서 도금강도를 증가시키기 위해 첨가하는 물질'),
	(15, '열전달제Heat transfer fluids', '열을 전달하고 열을 제거하는 물질'),
	(16, '유압유 및 첨가제 Hydraulic fluids and additives', '각종 압축기에 넣는 액체(기름)류 및 압력 전달 효율을 높이기 위해 첨가하는 물질'),
	(17, '잉크 및 토너 Ink and toners', '프린터나 전자복사기 등에 쓰여 영구적인 이미지 생성에 사용하는 물질'),
	(18, '다양한 공정 보조제(pH조절제, 응집제, 침전제, 중화제 등) Processing aids such as pH-regulators, flocculants, precipitants, neutraization agents', '공정의 안정성과 효율을 높이기 위하여 사용되는 각종 물질'),
	(18.1, '계면활성제 및 표면활성제 Surface-active agents', '한 분자 내에 친수기와 소수기를 지닌 화합물로서 액체의 표면에 부착해서 표면장력을 크게 저하시켜 활성화해주는 물질'),
	(18.11, '점도 조정제 Viscosity adjusters', '수지 등 고분자화합물을 용해한 점성재료의 농도를 안정화시켜 사용하기 쉽도록 해주는 물질'),
	(18.12, '응집제 및 침전제 Flocculants and precipitators', '물 등의 액체에 존재하는 여러 입자를 모여서 덩어리가 되도록 하거나 덩어리로 만들어 가라앉게 하는 물질'),
	(18.13, '소포제 Anti-foaming agents', '거품의 형성을 억제하는 물질'),
	(18.14, '촉매 Catalysts', '다른 물질의 화학반응을 매개하여 반응 속도를 빠르게 하거나 늦추는 물질'),
	(18.15, '착화제 Complexing agents', '주로 중금속 이온인 다른 물질에 배위자(配位子)로서 배위되어 착물(복합체)을 형성하는 물질 '),
	(18.16, '기타 공정 보조제 Other processing aids', '공정의 안정성과 효율을 높이기 위하여 사용되는 각종 물질로서 PC18.1부터 PC18.16에 해당하지 않는 물질'),
	(18.2, '부유제 Flotation agents', '광물질의 제련 공정 중에서 광물질을 농축ㆍ수거하기 위해 사용하는 물질'),
	(18.3, '주물용 융제 Flux agents for casting', '광물질을 녹이는 공정에서 산화물이 형성되는 것을 방지하기 위해 첨가하는 물질'),
	(18.4, '발포제 및 기포제 Foaming agents', '주로 플라스틱이나 고무 등에 첨가해서 작업공정 중 가스를 발생시켜 기포를 형성하게 하는 물질'),
	(18.5, '산화제 Fuel and additives', '특수한 조건에서 산소를 쉽게 발생시켜 다른 물질을 산화시키는 물질, 수소를 제거하는 물질 또는 화학반응에서 전자를 쉽게 받아들이는 물질'),
	(18.6, 'pH조절제 pH-regulating agents', '수소이온농도(pH)를 조절하거나 안정화하는데 사용하는 물질'),
	(18.7, '공정속도 조절제 Process regulators', '화학반응 속도를 조절함으로써 공정속도를 제어할 목적으로 사용하는 물질'),
	(18.8, '환원제 Reducing agents', '주어진 조건에서 산소를 제거하거나 또는 화학반응에서 전자를 제공하는 물질'),
	(18.9, '안정제 Stabilizers', '제조공정이나 사용 중에 열, 빛, 산소, 오존 등에 의해서 열화가 일어나 모양, 색깔, 물성이 변하는 것을 방지할 목적으로 사용하는 물질'),
	(19, '실험용 화학물질(시약) Laboratory chemicals', '실험실에서 기기분석 등에 사용되는 화학물질'),
	(20, '가죽 처리제 Leather treatment products', '가죽을 부드럽게 하는 등 다양한 목적을 위하여 가죽처리에 사용되는 물질'),
	(21, '윤활용제품 Lubricants, greases, release products', '기계의 마찰 부분의 발열이나 마모를 방지하거나 탈부착을 원활하게 하기 위해 사용되는 기름'),
	(21.1, '윤활유 Lubracants', '기계의 마찰 부분의 발열이나 마모를 방지하기 위해 사용되는 기름'),
	(21.2, '그리스 Grease', '기계의 마찰 부분의 발열이나 마모를 방지하기 위해 사용되는 점도가 높은 기름'),
	(21.3, '이형제 Release agents', '성형품을 거푸집으로부터 꺼낼 때 벗겨지기 쉽게하는 등 탈부착이 용이하도록 바르는 액체'),
	(21.4, '기타 윤활용 제품 Other lubricants', '기계의 마찰 부분의 발열이나 마모를 방지하거나 탈부착을 원활하게 하기 위해 사용되는 기름류 중에서 21.1부터 21.3에 해당하지 않는 물질'),
	(22, '금속 가공유 Metal working fluids(MWFs)', '금속재료의 천공, 절삭, 연마 등을 할 때 발생하는 마찰 저항과 온도 및 금속찌꺼기의 제거 등을 목적으로 사용되는 물질'),
	(22.1, '수용성 및 합성 금속가공유 Soluble and synthetic MWFs', '원유에서 정제한 윤활기유가 없거나 일부 있더라도 물과 섞이도록 만든 금속가공유'),
	(22.2, '비수용성 금속가공유 Insoluble MWFs', '원유에서 정제한 윤활기유가 주성분인 금속가공유로서 물이 함유되지 않은 것'),
	(22.3, '프레스오일 등 포밍유 Forming oil', '프레스 등 막대한 압력을 가해지는 금속가공으로부터 장비와 모재를 보호하기 위한 금속가공유'),
	(22.4, '방청제 Anti-rust oil', '금속의 가공 전후에 녹으로부터 보호하기 위하여 사용하는 물질'),
	(22.5, '기타 금속 가공유 Other MWFs', '금속가공유 중에서 22.1부터 22.4에 해당하지 않는 물질'),
	(23, '종이 및 보드 처리제 Paper and board treatment products', '종이 등의 제조 과정에서 사용되는 각종 물질'),
	(24, '식물보호제(농약) Plant protection products', '농작물을 균, 곤충, 응애, 선충, 바이러스, 잡초, 그 밖의 병해충으로부터 방제하는데 사용하는 물질. 다만, 비료는 제외한다.'),
	(25, '향수 및, 향 Perfumes, fragrances', '향을 내는 물질'),
	(26, '의약품 Pharmaceuticals', '병의 치료나 증상의 완화 등을 목적으로 의료에 사용되는 물질'),
	(27, '광화학제품 Photo-chemicals', '영구적인 사진 이미지를 만드는 데 사용하는 물질'),
	(28, '광택제 및 왁스 Polishes and wax blends', '표면의 윤기를 내기 위하여 사용하는 물질'),
	(29, '폴리머(고무 및 플라스틱) 재료(단량체 제외) Polymer preparations and compounds', '플라스틱과 고무를 제조하는데 사용되는 원료 및 첨가제 중 단량체물질을 제외한 모든 제품(플라스틱 및 고무제품에 사용되는 세척제나 이형제는 제외)'),
	(30, '반도체 Semiconductors', '규소단결정체처럼 절연체와 금속의 중간 정도의 전기저항을 갖는 물질로서 빛, 열 또는 전자기장에 의해 기전력을 발생하는 물질'),
	(31, '섬유용 안료 등 섬유 처리제 Textile dyes, and impregnating products', '섬유에 색을 입히거나 섬유의 질을 개선하기 위해 첨가하는 물질'),
	(32, '세정 및 세척제 Washing and cleaning products', '표면의 오염을 제거하는데 사용되는 액체로서 물이나 용제를 포함'),
	(33, '경수 연화제 Water softeners', '물 속의 칼슘이나 마그네슘 등을 제거하여 경수를 연수로 변화시키는 물질'),
	(34, '수처리제 Water treatment chemicals', '오염된 물을 정수 또는 소독하기 위하여 사용되는 물질'),
	(35, '용접 납땜 재료 및 플럭스 Welding and soldering products, flux products', '금속류의 용접 및 납땜질을 할 때 사용하는 물질'),
	(36, '화장품 및 개인위생용품 Cosmetics, personal care products', '인체를 청결 미화하는 등의 목적으로 사용되는 물질'),
	(37, '용제 및 추출제 Solvent and extraction agents', '녹이거나 희석시키거나 추출, 탈지를 위해 사용하는 물질'),
	(38, '배터리 전해제 Electrolytes for batteries', '배터리의 전기 전달을 돕는 물질'),
	(39, '색소 Coloring agent', '페인트나 잉크 등의 색을 내는 데 사용되는 물질'),
	(40, '단열재 및 건축용 재료 Construction materials', '열의 소실을 막기 위하여 사용되는 재료 등 건축에 사용되는 재료'),
	(41, '전기 절연제 Insulating materials', '전기가 통하지 않도록 차단하는 물질'),
	(42, '에어로졸 추진체 Propellant', '압축가스 또는 액화가스로서 용기에서 가스를 분사함으로써 내용물을 분출시키는 물질'),
	(43, '응축방지제 Condensation inhibitor', '물체의 표면에서 액체가 응축되는 것을 방지할 목적으로 사용하는 물질'),
	(44, '접착방지제 Anti-adhesive agents', '두 개체 접촉면의 접착을 방지할 목적으로 사용하는 물질'),
	(45, '정전기방지제 Anti-static agents', '정전기 발생을 방지하거나 저감하는 물질'),
	(46, '분진결합제 Dust binding agents', '분진의 발생ㆍ분산을 방지하기 위해 첨가하는 물질'),
	(47, '식품 및 식품첨가물 Food and food additives', '식품(의약으로 섭취하는 것은 제외한다) 및 식품을 제조ㆍ가공 또는 보존하는 과정에서 식품에 넣거나 첨가하는 물질'),
	(48, '기타 Others', '1부터 47에 해당하지 않는 그 밖의 물질');
