	(4, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '피부 부식성', '', '', 'HSDB', '', '자극성이 나타남()', '', '', 'IPCS', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '피부과민성이 관찰()', '', '', 'IPCS', '장기 또는 반복노출', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '해당없음', '', '', '', '', '', '', '암/수 쥐의 생식능력을 저하시킨다고 보고됨;쥐', '', '', 'HSDB', '발달독성(모체 체중 증가 억제가 나타나는 용량에서 태아의 발육지연 및 뇌의 미발달이 관찰됨. 흰쥐의 임신·수유기간 투여 시험에서 모유의 분비가 현저하게 감소하고 대부분의 출생자가 사망하는 것으로 보고됨;흰쥐;;HSDB)최기형성( Mice에서 최기형성을 나타낸다고 보고됨;Mice;;HSDB', '태반 및 수유를 통해 태아로 전달된다고 보고됨', '', '', '', '', '자료없음', '', '', '', '', '', '', '', '', '', '', '', '', '자료없음', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '구분2', '구분1', '구분1', NULL, NULL, '구분1C', '구분2A', '해당없음', '구분1B', '구분1B', '구분1A', '구분2', '해당없음', '구분1', '해당없음', '구분3(마취영향)', '구분2', '구분1', '10290-12-7#1'),
	(5, 'Rat', 'LD50', '2900', '', '', '', '', '㎎/㎏', 'OECD TG 401, GLP', '', 'ECHA', '', 'Rat', 'LD50', '', '2000', '', '', '', '㎎/㎏', '', '', 'ECHA', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '해당없음', '', '', '', '', '', '', '마우스를 이용한 생식독성 시험결과 생식독성이 관찰되지 않음.;마우스', '', '', 'ACGIH, NITE', '', '', '', '', '', '', '경구: 투여 후 죽은 것으로 밝혀진 랫드는 붉은 색의 장을 보였고 장은 액체로 팽창 된 것으로 나타났음 (최고 용량의 경우에는 보이지 않음). 회장에서의 적색 영역은 1650 mg/kg을 제공한 2 마리 랫드에서 보고되었고, 500 mg/kg의 탄산 암모늄 지르코늄을 제공 한 수컷 랫드는 확장된 소화관을 갖는 것으로 나타났음. 다른 보고된 결과는 처리와 관련이 없는 것으로 간주되었음.(랫드 / 수컷/암컷 / 동등하거나 유사한 가이드라인: OECD TG 401 / GLP)', '', '', '', '', '', '', '', '', '', '', '', '', '경구(단기반복투여): 랫드(암/수컷)를 통해 최대 1000 mg/kg/day의 용량 수준에서 연속 45일 동안 경구 노출한 결과, 독성학적으로 유의한 영향을 미치지 않았음. 따라서, 두 성별의 동물에 대한 NOEL은 전신 독성에 대해 1000mg/kg/day로 간주됨. 최대 1000 mg/kg/day의 용량 수준에서 생식 기능 및 자손 발달에 대한 처리 관련 효과는 발견되지 않았음. 따라서 NOEL은 생식 및 발달 독성에 대해 1000 mg/kg/day로 간주됨, Rat, OECD TG 422, GLP', '', '', 'ECHA', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '구분2', '구분1', '자료없음', NULL, NULL, '해당없음', '구분2B', '해당없음', '구분1', '해당없음', '해당없음', '구분1', '해당없음', '해당없음', '해당없음', '해당없음', '해당없음', '구분2', '68309-95-5#1'),
	(6, 'Rat', 'LD50', '6400', '', '', '', '', '㎎/㎏', '', '', 'Registry of Toxic Effects of Chemical Substances', '', 'Rabbit', 'LD50', '', '20000', '', '', '', '㎎/㎏', '', '', 'Registry of Toxic Effects of Chemical Substances', '', 'Rat', 'LC50', '0.05', '', '', '0.5', '', '㎎/ℓ', '4 hr', '미스트', '', '', '산업안전보건연구원 GLP 독성 시험, 2018', '', 'BC는 피부와 눈과 호흡기에 자극적이며 동물실험에서 BC는 급성경피독성물질로 나타났다.토끼를 대상으로 피부접촉 테스트 시 , 50%수용액은 부식성인 반면, 33%또는 10% 수용액은 부식에 의한 자극을. 7.5%수용액은 자극을 유발함. EU CLP에서 피부부식성 구분1 B로 분류하므로 구분1로 분류(Rabbit)', '', '', 'Swedish Chemical Agency GESTIS EU CLP', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '흡입 시 기관지 수축, 및 천식을 유발할 수 있음', '', '', 'HSDB', '', '병원에서 해당물질을 함유 한 세척 및 소독제를 사용한 후 직장에서 알레르기 성 접촉 성 피부염이 분리 된 사례가 보고되나 분류에 적용하기에 불충분()', '', '', 'GESTIS', '', '', '', '', '', '', '', '', '설치류에 대한 mammalian cells시험 시 음성 미생물에 대한 시험, 포유 동물 세포에 대한 in vitro 실험 시 음성', '', '', 'GESTIS', '', NULL, '해당없음', '', '', '', '', '', '', '랫드(암/수)를 이용한 생식독성 실험결과 고환의 위축과 임신의 감소가 보임 ;랫드;NOAE=500 mg/kg bw/day / NOAE=300 mg/kg bw/day;', 'OECD Guideline 422 , GLP', '', 'ECHA', '발달독성(랫드를 이용한 발달독성/최기형성 실험결과, 1000 mg/kg/day에서 두마리의 암컷은 사망을 보임;랫드;OECD Guideline 414 , GLP;ECHA)', '', '', '', '', '', '자료없음', '', '', '', '', '', '', '', '', '', '', '', '', '랫드에 10000ppm농도에서 4주 동안 섭취 시 수컷에서 몸무게 감소, >3500ppm에 암컷과 10000ppm수컷에서 간 무게 증가, >3500ppm에 수컷에서 간장병이 크게 나타남, 10000ppm에 수컷에서 centrilobular hepatocyte enlargement이 관찰됨. ', '', '', 'Hazardous Substances Data Bank(http://toxnet.nlm.nih.gov/cgi-bin/sis/htmlgen?HSDB)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '구분4', '구분3', '구분1', NULL, NULL, '구분2', '구분2A', '구분1A', '구분1A', '구분1A', '자료없음', '자료없음', '수유독성', '구분2', '해당없음', '구분3(마취영향)', '구분2', '해당없음', '42576-02-3#1'),
