	(15, 'Rat', 'LD50', '31', '', '', '', '', '㎎/㎏', '', '', 'ChemIDplus, NCIS', '', 'Rabbit', 'LD50', '229', '', '', '', '', '㎎/㎏', '', '', 'NITE', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '래빗에 GLP조건의 24시간 피부 자극성 시험에서 중자극임(Rabbit)', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '사람에게 GLP조건의 피부 패칭 테스트 결과 민감성 아님(Human)', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis) ', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '구분2', '', '', '', '', '', '', '랫드를 이용한 2세대 흡입생식독성시험결과, 부모세대에서 수컷에게 비루(nasal discharge), 암컷에게 붉은 털(red-tinged fur)관찰됨. 비염, 호흡상피의 과형성 및 형성장애 발견되었으며, 과형성(hyperplasia) 빈도가 증가함. 고농도에서 F1에게 비염 및 점막하 조직의 림프구 침투(submucosal lymphoid infiltrates) 발병률 증가함.;랫드;흡입;NOAEC(P)=0.08 ppm / NOAEC(F1)=0.3 ppm / NOAEC(F2)=0.02 ppm / NOAEC(P)=0.08 ppm / NOAEC(F1)=0.3 ppm / NOAEC(F2)=0.02 ppm;', 'OECD TG 416, GLP', '', 'ECHA', '발달독성(랫드를 이용한 흡입발달독성시험결과, 현저한 체중 및 음식소비량 감소 생식과 발달에 관련된 독성영향은 관찰되지 않음;랫드;OECD TG 414, GLP;ECHA)', '', '', '', '', '', '단기간 노출 영향: 콜린에스테라제(Cholinesterase) 억제. 이 물질은 신경계에 영향을 야기할 수 있음. 경련 및 호흡 저하의 원이 될 수 있음', '', '', '', '', '', '', '', '', '', '', '', '', '장기간 및 반복노출 영향: 콜린에스테라제(Cholinesterase) 억제. 누적 효과 가능함 최대 2년의 동물 실험에서 고농도군에서 떨림(먹이 투여) 또는 호흡기의 자극(흡입)이 관찰됨. 지침범위 내에서는 영향 관찰되지 않음', '', '', 'NITE, IPCS', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '자료없음', '구분4', '구분4', NULL, NULL, '구분2', '구분2A', '자료없음', '해당없음', '해당없음', '구분1A', '구분1B', '수유독성', '구분1', '해당없음', '자료없음', '해당없음', '구분2', '2595-54-2#1'),
