	(37, 'Rat', 'LD50', '', '200', '', '', '', '㎎/㎏', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', 'Rabbit', 'LD50', '', '5010', '', '', '', '㎎/㎏', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', 'Rat', 'LC50', '1.3', '', '', '', '', '㎎/ℓ', '4 hr', '분진', '', '', 'RTECS, NLM', '', '자극성이 나타남(Rabbit)', '', '', 'RTECS', '', '(Rabbit)', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'GENETOX', '', NULL, '구분2', '', '', '', '', '', '', '마우스를 이용한 생식독성 실험결과, 수컷에서 정자 운동성 감소, 암컷은 체중 증가하였으나 생식과 관련된 영향은 관찰되지 않음;마우스;NOAEL=25 mg/kg bw/day;', 'OECD TG414, GLP', '', 'ECHA, OECD SIDS', '발달독성(랫드를 이용한 발달독성/최기형성 실험결과, 감소된 음식 소비, 소변 얼룩, 탈모증이 관찰됨;랫드;;ECHA, OECD SIDS)', '', '', '', '', '', '자료없음', '', '', '', '', '', '', '', '', '', '', '', '', '랫드(수컷,암컷)에 28일간 GLP 경구 시험의 결과 NOAEL은 1000ppm, LOAEL은 5000ppm이었다. 1000-5000ppm용량 그룹에서 죽은 동물은 없었으며, 처치와 관련된 병리학상의 유의한 점을 찾을 수 없었다. 그러나 5000-10000ppm 암컷 그룹에서 대조군과 비교하여 유의하게 간 무게가 증가하였다. ', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '구분4', '구분4', '구분2', NULL, NULL, '구분1C', '구분2B', '자료없음', '해당없음', '구분2', '자료없음', '구분1A', '수유독성', '구분1', '구분3(호흡기 자극)', '해당없음', '구분1', '자료없음', '68610-51-5#1'),
