	(50, 'Rat', 'LD50', '3600', '', '', '', '', '㎎/㎏', '', '', 'ECHA', '', 'Rabbit', 'LD50', '', '20000', '', '', '', '㎎/㎏', '', '', 'ECHA', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'TOPCAT;Skin Irritation', '', '', '', '', 'TOPCAT;Ocular Irritancy SEV vs MOD', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'Genetic Toxicology(http://toxnet.nlm.nih.gov/cgi-bin/sis/htmlgen?GENETOX)', '', NULL, '해당없음', '', '', '', '', '', '', '랫드(암/수)를 이용한 생식독성 시험결과 비정상적인 정자 및 꼬리 정자의 발생률이 크게 증가, 간중량 증가, 수컷의 신장무게 감소, 새끼들 체중증가;랫드;NOAEL parental=15 000 ppm / NOAEL pups = 3 000 ppm / NOAEL maternal toxicity =0.25% / NOAEL developmental toxicity=2.5%;', 'OECD Guideline 416,GLP', '', 'ECHA', '최기형성(랫드를 이용한 반복독성/최기형성 시험결과 체중증가량이 감소, 음식소비량 감소, 척추리브의 증가;랫드;OECD Guideline 414,GLP;ECHA', '', '', '', '', '', '자료없음', '', '', '', '', '', '', '', '', '', '', '', '', '수컷 랫드에 3주간 하루 2ml/kg의 용량으로 경피 투여를 한 결과 시험기간 동안 한 마리가 죽었다. 또한, 대조군보다 시험군에서 alopaecia의 통증, 항문주변의 황색착색, 쇠약의 발생과 피부 반응이 있었으며, 피부반응은 부종, 홍반, 열창, 화상자국의 형성, 박리작용을 포함한다. 시험군의 몸무게, 전립선, 정낭의 무게감소 그리고 부신 증가는 통계적으로 유의 하였으나, 미시적인 평가에서 다른 연령집단의 어떤 처리군에서 영향은 나타나지 않았다. ', '', '', 'IUCLID, European chemical Substances Information Systemhttp://ecb.jrc.it/esis ', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '자료없음', '자료없음', '구분3', NULL, NULL, '자료없음', '구분2A', '자료없음', '구분1B', '구분1A', '자료없음', '구분2', '자료없음', '자료없음', '자료없음', '구분3(마취영향)', '자료없음', '자료없음', '68457-79-4#1'),
