	(84, 'Rat', 'LD50', '100', '', '', '', '', '㎎/㎏', '', '', 'HSDB', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '해당없음', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '사람에게서 신부전이나 심부전 유발(HSDB,2002)라는 기술이 있기 때문에, NITE에서 구분2(골격근,신장,심장)로 분류', '', '', '', '', '', '', '', '', '', '', 'NITE', '', '자료없음', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '자료없음', '자료없음', '자료없음', NULL, NULL, '자료없음', '구분2A', '구분1', '구분1B', '구분1A', '자료없음', '자료없음', '자료없음', '자료없음', '자료없음', '구분3(마취영향)', '구분2', '구분2', '17090-79-8#1'),
	(85, 'Rat', 'LD50', '30', '', '', '', '', '㎎/㎏', '', '', 'ChemIDplus', '', 'Rat', 'LD50', '100', '', '', '', '', '㎎/㎏', '', '', 'ChemIDplus', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '피부자극성 실험에서 일시적인 경자극임(Rabbit)', '', '', 'OECD Screening Information Data Set(http://cs3-hq.oecd.org/scripts/hpv/)', '', '', '', '', 'TOPCAT;Ocular Irritancy SEV vs MOD', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'OECD Screening Information Data Set(http://cs3-hq.oecd.org/scripts/hpv/)', '', NULL, '해당없음', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '랫드를 이용한 급성경구독성 시험 결과 혈장, 적혈구, 뇌 콜리네스트라제 활성 감소. 효과가 가장 컷을 때 감소량은 55~61%였으며, 10mg/kg이상 투여시 콜리네스트라제 억제에 의한 독성 증상 관찰됨. 인간을 이용한 급성경구독성 시험 결과 항콜리네스트라제 독성 증상이 나타나지 않았지만, 1mg/kg 이상 투여시 혈장과 적혈구 콜리네스트라제 활성 감소. 최대치일 때 감소치는 70% 나타남. 또한, 여성이 12g을 섭취하여 자살을 시도한 사례에서 여성에게 축동, 반사 항진, 줄기 수축, 혼수 관찰되었으며 혈장 콜리네스트라제 수준이 정상의 10% 수준으로 떨어짐. ', '', '', '', '', '', '', '', '', '', '', '', '', '랫드를 이용한 신경 독성 시험(15일) 결과 Category 1에 해당하는 복용량에서 떨림, 실조성 파행, rearing 감소, 동공 수축, 체온 감소, 운동성 감소, 뇌 콜리네스트라제 활성 억제 관찰. 랫드를 이용한 반복경구독성시험(13주) 결과 Category 1에 해당하는 복용량에서 떨림, 공격적 행동, 뒷다리 악력 감소, 체온 감소, 혈장, 적혈구, 뇌의 콜리네스트라제 활성 억제 관찰. 마이스를 이용한 반복경구독성시험(21개월, JMPR 1004, 2002), 랫드를 이용한 반복경구독성시험(21일, JMPR 102, 1967), 랫드를 이용한 반복경구독성 시험(6개월, 2004), 랫드를 이용한 반복경구독성시험(14일, 2004) 결과 적혈구와 뇌 콜리네스트라제 활성 억제가 관찰되었으며, 인간 자원봉사자들에게서도 혈장과 적혈구 콜리네스트라제 활성 억제 관찰됨', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '자료없음', '구분1', '구분3', NULL, NULL, '구분1A', '구분2B', '구분1B', '구분1', '구분1B', '구분1B', '자료없음', '자료없음', '자료없음', '자료없음', '자료없음', '구분2', '구분2', '301-12-2#1'),
