	(93, 'Rat', 'LD50', '', '5000', '', '', '', '㎎/㎏', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', 'Rabbit', 'LD50', '', '2000', '', '', '', '㎎/㎏', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '구분2', '', '', '', '', '', '', '2세대 생식 독성 연구를 통하여 수컷 및 암컷 랫드에게 0, 50, 250, 750 mg/kg bw/day의 용량의 BBP를 경구 식이노출한 결과 최고 용량에서 F1세대의 생식에 악영향을 미쳤으며, F1 및 F2 자손의 성장 장애 및 성 성숙을 지연시켰음. 250 mg/ kg bw/day 농도에서 F1 및 F2 수컷 새끼의 생식기 간격이 짧아짐, EPA OPPTS 870.3800, GLP 식이 중 벤질 부틸 프탈레이트는 임신 6-15 일에 0.5, 1.25 또는 2 % (각각 0, 420, 1100 또는 1640 mg / kg bw / day의 섭취 결과) 수준으로 투여됨. 두 단계의 높은 용량 수준에서 발달 및 모체 독성을 유발하며, 가장 낮은 복용량 인 0.5 %에서 태아에 대한 명백한 영향은 없었으며, 이는 모계 및 발달 종료점 모두에 대해 관찰 된 부작용 수준 (NOAEL) 인 것으로 간주되었음., rat;rat', 'equivalent or similar to Guideline: OECD TG 414, GLP', '', ' ECHA', '', '', '', '', '', '', '랫드에 경구 투여의 LD50은 5000mg/kgbw초과이며, 임상학적 징후로 설사와 코와 입주위에 유혈을 포함한다.  폐에 중증 자극과 fluid-filled종기에 울혈, 내장, 위에 출혈이 보여진다. 몇몇 동물은 심장은 확장 또는 불규칙함을 나타냈다. ', '', '', '', '', '', '', '', '', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', '랫드에 90일동안 하루 6시간씩 흡입 노출 시킨 결과 NOAEL은 1552ppm이고, 가장 높은 용량에 노출된 수컷 쥐에게만 생물학적으로 유의하게 찾아내었다. 수컷 쥐에 재생피막이 나타났으며, 신장 안에 세관이 팽창되었다. 이 영향은 암컷 쥐에 존재하지 않으며, 사람과 관련이 없다. ', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '자료없음', '자료없음', '구분3', NULL, NULL, '구분1C', '자료없음', '해당없음', '자료없음', '자료없음', '자료없음', '자료없음', '자료없음', '자료없음', '자료없음', '구분3(마취영향)', '구분2', '구분1', '101795-01-1#1'),
