	(95, 'Rat', 'LD50', '', '5000', '', '', '', '㎎/㎏', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', 'Rabbit', 'LD50', '', '2000', '', '', '', '㎎/㎏', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '드레이즈테스트 중자극(Rabbit)', '', '', 'HSDB, RTECS', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '해당없음', '', '', '', '', '', '', '랫드를 이용한 2세대 생식독성시험결과 P1 암컷 새끼에서 임신전 분만일수 증가, F1수컷에서 깨진 편모 관찰되는 정자의 수가 증가, 평균 고환 정자 수는 유의하게 감소함. 육안 병리병변, 현미경적 병리학적 소견(단세포 괴사, 색소침착), F1 수컷 부모쥐에서 평균 고환 정자수 및 고환무게의 유의한 감소 관찰로 NOAEL(생식독성) = 10 mg/kg/day 모계독성/최기형성 시험결과 출산율 감소, 성관계 감소, 성비의 변화, 골격과 조직의 기형이 발생함.;랫드;NOAEL(생식독성) = 10 mg/kg/day / NOAEL = 30 mg/kg bw/day;', '', '', 'HSDB, NITE', '', '', '', '', '', '', '랫드에 경구 투여의 LD50은 5000mg/kgbw초과이며, 임상학적 징후로 설사와 코와 입주위에 유혈을 포함한다.  폐에 중증 자극과 fluid-filled종기에 울혈, 내장, 위에 출혈이 보여진다. 몇몇 동물은 심장은 확장 또는 불규칙함을 나타냈다. rat;  oral LD50>5000mg/kgbw; Clinical signs included diarrhoea and blood around the nose and mouth. At necropsy, lungs ahowed effects ranging from mild irritation and congestion to fluid-filled abscesses. Intestines, and often the stomach, were found to be haemorrhaging. In some animals the heart  was enlarged or irregular.', '', '', '', '', '', '', '', '', '', '', 'European chemical Substances Information System_(http://ecb.jrc.it/esis)', '', '랫드에 90일동안 하루 6시간씩 흡입 노출 시킨 결과 NOAEL은 1552ppm이고, 가장 높은 용량에 노출된 수컷 쥐에게만 생물학적으로 유의하게 찾아내었다. 수컷 쥐에 재생피막이 나타났으며, 신장 안에 세관이 팽창되었다. 이 영향은 암컷 쥐에 존재하지 않으며, 사람과 관련이 없다. rat; inhalation; GLPdata; NOAEL=1552ppm;  90day,6hr/day,5day/week; The only  significant biological finding concerned the male rats exposed to the highest dose of  test substance. These male animals displayed regenerative epithelium and dilated tubules in the kidneys. These effects were not present in female rats, and are