	(98, 'Mouse', 'LD50', '150', '', '', '', '', '㎎/㎏', '', '', 'Registry of Toxic Effects of Chemical Substances', '', 'Rat', 'LD50', '1420', '', '', '', '', '㎎/㎏', '', '', 'Registry of Toxic Effects of Chemical Substances/ National Library of Medicine(http://toxnet.nlm.nih.gov/cgi-bin/sis/htmlgen?CHEM)', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', NULL, '구분1B', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '체내 흡수 시 혈압강하, 심장기능장애, 근육이완 및 중추신경계 장애(의식상실, 발작)을 유발할 수 있음해당물질이 포함된 용액을 삼키면, 폐로 흡인되어 화학성 폐렴을 유발할 수 있음※표적장기 : 심혈관계, 중추신경계, 호흡기', '', '', '', '', '', '', '', '', '', '', 'ICSC', '', '특정표적장기독성(반복노출: 호흡기계) - 아만성 반복흡입독성(미스트, 90일, 반복 전신흡입노출) NOAEC 0.22 mg/m3 이하 (랫드-호흡기계)(산업안전보건연구원 GLP 독성 시험, 2018) ', '', '', '산업안전보건연구원 GLP 독성 시험, 2018', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '자료없음', '자료없음', '자료없음', NULL, NULL, '구분1B', '구분2B', '자료없음', '구분1B', '자료없음', '구분1A', '자료없음', '수유독성', '구분1', '자료없음', '자료없음', '구분1', '자료없음', '63449-41-2#1'),
	(99, 'Rat', 'LD50', '', '7000', '', '', '', '㎎/㎏', '', '', 'European chemical Substances Information System(http://ecb.jrc.it/esis)', '', 'Rabbit', 'LD50', '', '2000', '', '', '', '㎎/㎏', '', '', 'European chemical Substances Information System(http://ecb.jrc.it/esis)', '', 'Rat', 'LC50', '', '0.575', '', '', '', '㎎/ℓ', '4 hr', '분진', '', '', 'OECD Screening Information Data Set(http://cs3-hq.oecd.org/scripts/hpv/)', '', '피부에 자극성없음(Rabbit)', '', '', 'OECD Screening Information Data Set(http://cs3-hq.oecd.org/scripts/hpv/)', '', '경미하거나 중간 자극(Rabbit)', '', '', 'OECD Screening Information Data Set(http://cs3-hq.oecd.org/scripts/hpv/)', '', '', '', '', '', '', '', '', NULL, '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', 'OECD Screening Information Data Set(http://cs3-hq.oecd.org/scripts/hpv/)', '', NULL, '해당없음', '', '', '', '', '', '', '이 연구에서 DBP는 성체와 개발 중에 노출 된 랫드에서 생식 독성 물질인 것으로 나타남. 2세대에 대한 영향은 1세대보다 컸으며, 이 연구에서 가장 낮은 용량 수준(식이)에서 0.1 % (수컷의 경우 52 mg/kg bw, 암컷의 경우 80 mg/kg bw)는 배아 독성에 대한 LOAEL임. 모체 독성에 대한 NOAEL은 식이에서 0.5 % (385 mg/kg bw). 성인 수컷 랫드의 주산기(교배전 21일~임신 14일)에서 식이를 통해 2 mg DBP/kg bw/day 이상에 노출된 성인 수컷 랫드의 유선변화와 유방세포의 발달이 감소된 것을 확인함, NOAEL 발견되지 않음, LOAEL은 모체 식이에서 20ppm으로 결정됨(1.5？3.0 mg/kg/day), 1001 mg DBP/kg bw/day에서 수컷 비생식 거리는 감소했고, 젖꼭지 유지력은 증가함, rat;rat', '', '', 'ECHA', '', '', '', '', '', '', '자료없음', '', '', '', '', '', '', '', '', '', '', '', '', '자료없음', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '구분4', '자료없음', '자료없음', NULL, NULL, '구분1C', '구분2B', '자료없음', '자료없음', '구분1A', '자료없음', '자료없음', '자료없음', '구분2', '구분3(호흡기 자극)', '자료없음', '구분2', '구분1', '64741-70-4#1'),
