	(1, NULL, NULL, NULL, NULL, ';GHS08A;GHS09A;GHS02A;GHS01A;GHS06A;GHS07A;GHS04A;GHS05A', '위험', 'H204 화재 또는 분출 위험;H224 극인화성 액체 및 증기;H252 대량으로 존재 시 자기발열성: 화재를 일으킬 수 있음;H271 화재 또는 폭발을 일으킬 수 있음: 강산화제;H300 삼키면 치명적임;H304 삼켜서 기도로 유입되면 치명적일 수 있음;H312 피부와 접촉하면 유해함;H314 피부에 심한 화상과 눈에 손상을 일으킴;H317 알레르기성 피부 반응을 일으킬 수 있음;H319 눈에 심한 자극을 일으킴;H330 흡입하면 치명적임;H335 호흡기계 자극을 일으킬 수 있음;H340 유전적인 결함을 일으킬 수 있음(주1);H350 암을 일으킬 수 있음(주2);H360 태아 또는 생식능력에 손상을 일으킬 수 있음(주3)(주4);H371 장기(주5)에 손상을 일으킬 수 있음(주6);H372 장기간 또는 반복노출 되면 장기(주5)에 손상을 일으킴(주7);H400 수생생물에 매우 유독함;H412 장기적인 영향에 의해 수생생물에게 유해함', 'P201 사용 전 취급 설명서를 확보하시오.;P202 모든 안전 예방조치 문구를 읽고 이해하기 전에는 취급하지 마시오.;P210 열, 고온의 표면, 스파크, 화염 및 그 밖의 점화원으로부터 멀리하시오. 금연;P220 의류 및 그 밖의 가연성 물질로부터 멀리하시오.;P233 용기를 단단히 밀폐하시오.;P234 원래의 용기에만 보관하시오.;P235 저온으로 유지하시오.;P240 용기와 수용설비를 접지하시오.;P241 방폭형 (전기·환기·조명·(...))설비를 사용하시오. ;P242 스파크가 발생하지 않는 도구를 사용하시오.;P243 정전기 방지 조치를 취하시오.;P250 연마·충격·마찰·(...)을(를) 가하지 마시오.;P260 분진·흄·가스·미스트·증기·스프레이를(을) 흡입하지 마시오.;P261 분진·흄·가스·미스트·증기·스프레이의 흡입을 피하시오.;P264 취급 후에는 …을(를) 철저히 씻으시오.;P270 이 제품을 사용할 때에는 먹거나, 마시거나 흡연하지 마시오.;P271 옥외 또는 환기가 잘 되는 곳에서만 취급하시오.;P272 작업장 밖으로 오염된 의복을 반출하지 마시오.;P273 환경으로 배출하지 마시오. ;P280 보호장갑·보호의·보안경·안면보호구를(을) 착용하시오.;P283 방화복 또는 방염복을 입으시오;P284 (환기가 잘 되지 않는 경우) 호흡기 보호구를 착용하시오.', 'P301+P310 삼켰다면: 즉시 의료기관·의사·(…)의 진찰을 받으시오.;P301+P330+P331 삼켰다면 입을 씻어내시오. 토하게 하려 하지 마시오.;P302+P352 피부에 묻으면: 다량의 물·(…)(으)로 씻으시오.;P303+P361+P353 피부(또는 머리카락)에 묻으면: 오염된 모든 의복은 벗으시오. 피부를 물로 씻으시오/샤워하시오 .;P304+P340 흡입하면: 신선한 공기가 있는 곳으로 옮기고 호흡하기 쉬운 자세로 안정을 취하시오.;P305+P351+P338 눈에 묻으면: 몇 분간 물로 조심해서 씻으시오. 가능하면 콘택트렌즈를 제거하시오. 계속 씻으시오.;P306+P360 의류에 묻으면: 의류를 벗기 전에 오염된 의류 및 피부를 다량의 물로 즉시 씻어내시오.;P308+P311 노출되거나 노출이 우려되면: 의료기관·의사·(…)의 진찰을 받으시오.;P308+P313 노출되거나 노출이 우려되면: 의학적인 조치·조언을 구하시오.;P310 즉시 의료기관/의사/…의 진찰을 받으시오.;P312 불편함을 느끼면 의료기관/의사/…의 진찰을 받으시오.;P314 불편함을 느끼면 의학적인 조치/조언을 받으시오.;P320 긴급히 … 처치를 하시오.;P321 … 처치를 하시오.;P330 입을 씻어내시오.;P331 토하게 하지 마시오.;P333+P313 피부자극성 또는 홍반이 나타나면: 의학적인 조치·조언을 구하시오.;P337+P313 눈에 자극이 지속되면: 의학적인 조치·조언을 구하시오.;P362+P364 오염된 의복은 벗고 다시 사용 전